            <a href="https://open.spotify.com/user/0es11mn5j8hp979hec6kp1qpr?si=976d9d0bc2a24a97" target="_blank"><img src="https://fruitioncreativemedia.b-cdn.net/spotify.png" className='social'></img></a>
            </div>
          </center>
        </div>





    </div>

    )




  }
}
export default Home;
